                ), "'https://'", "''"
            ), "'/'", 1
        ), "'?'", 1
    )

-%}


    {{ dbt_utils.safe_cast(
        parsed,
        dbt_utils.type_string()
        )}}

{%- endmacro %}

macro.dbt_utils.default__get_url_paramet.macro_sql:
{% macro default__get_url_parameter(field, url_parameter) -%}

{%- set formatted_url_parameter = "'" + url_parameter + "='" -%}

{%- set split = dbt_utils.split_part(dbt_utils.split_part(field, formatted_url_parameter, 2), "'&'", 1) -%}

nullif({{ split }},'')

{%- endmacro %}

macro.dbt_utils.default__get_url_path.macro_sql:
{% macro default__get_url_path(field) -%}

    {%- set stripped_url = 
        dbt_utils.replace(
            dbt_utils.replace(field, "'http://'", "''"), "'https://'", "''")
    -%}

    {%- set first_slash_pos -%}
        coalesce(
            nullif({{dbt_utils.position("'/'", stripped_url)}}, 0),
            {{dbt_utils.position("'?'", stripped_url)}} - 1
            )
    {%- endset -%}

    {%- set parsed_path =
        dbt_utils.split_part(
            dbt_utils.right(
                stripped_url, 
                dbt_utils.length(stripped_url) ~ "-" ~ first_slash_pos
                ), 
            "'?'", 1
            )
    -%}

    {{ dbt_utils.safe_cast(
        parsed_path,
        dbt_utils.type_string()
    )}}

{%- endmacro %}
